import BasicLayouts from '@antdp/basic-layouts';

const Layout = () => {
  const token = '';
  return (
    <Authorized authority={!!token} redirectPath="/login">
      <BasicLayouts projectName="Ant Design" />
    </Authorized>
  );
};

export default Layout;
